import React from "react";
import styles from "./SideBar.module.css";

const Header = () => {
  return (
    <div className={styles.sideBar}>
      <div className={styles.sideBarTop}>
        <ul className={styles.home}>
          <img src={require("../../Assets/Icons/home_Icon.png")} alt="" />
          <span className={styles.sideBarHomeAndSearch}>Home</span>
        </ul>
        <ul className={styles.search}>
          <img src={require("../../Assets/Icons/seacrh_Icon.png")} alt="" />
          <span className={styles.sideBarHomeAndSearch}>Search</span>
        </ul>
      </div>
    </div>
  );
};

export default Header;
